   "source": [
    "# Подключаем библиотеки\n",
    "if(!require(tidyverse)) install.packages(\"tidyverse\")\n",
    "library(tidyverse)\n",
    "\n",
    "# 1. Загрузка данных\n",
    "df <- read.csv(\"/kaggle/input/new-york-housing-market/NY-House-Dataset.csv\")\n",
    "\n",
    "\n",
    "df_selected <- df %>%\n",
    "  select(PRICE, TYPE, BEDS, BATH, PROPERTYSQFT, LATITUDE, LONGITUDE)\n",
    "\n",
    "\n",
    "df_filtered <- df_selected %>%\n",
    "  filter(PRICE < 100000000)\n",
    "\n",
    "\n",
    "df_clean <- na.omit(df_filtered)\n",
    "\n",
    "\n",
    "print(paste(\"Строк до чистки:\", nrow(df)))\n",
    "print(paste(\"Строк после чистки:\", nrow(df_clean)))\n",
    "\n",
    "# 3. Подготовка данных для PCA\n",
    "\n",
    "X_matrix <- model.matrix(~ . - 1 - PRICE, data = df_clean)\n",
    "\n",
    "# 4. Снижение размерности (PCA)\n",
    "pca_result <- prcomp(X_matrix, center = TRUE, scale. = TRUE)\n",
    "\n",
    "summary(pca_result)\n",
    "\n",
    "data_pca <- as.data.frame(pca_result$x[, 1:7])\n",
    "data_pca$PRICE <- df_clean$PRICE\n",
    "\n",
    "# 5. Построение уравнения регрессии\n",
    "model <- lm(PRICE ~ ., data = data_pca)\n",
    "\n",
    "# 6. Оценка точности, значимости и достоверности\n",
    "summary(model)"
   ]
  },
