    "Первые семь компонент объясняют 56.4% всей дисперсии. Немного, но ладно.\n",
    "Первые пять компонент оказывают статистически значимое влияение на цену, pc6 и pc7 - нет (\n",
    "R2 = 0.248, модель объясняет всего четверть разброса цен. Модель статистически значима p-value: < 2.2e-16. (p-value 0.076 и  0.108 соответственно.)\n"
