    "library(gridExtra)\n",
    "theme_set(theme_minimal())\n",
    "conflict_prefer(\"filter\", \"dplyr\")\n",
    "conflict_prefer(\"select\", \"dplyr\")\n",
    "\n",
    "df <- read_delim(\"/kaggle/input/raisin-binary-classification/Raisin_Dataset.csv\", delim = \",\", show_col_types = FALSE)\n",
