   "source": [
    "# 1. Отделяем признаки (X) и целевую переменную (y)\n",
    "X <- df %>% select(-Class)\n",
    "y <- as.factor(df$Class) \n",
    "\n",
    "# 2. Запускаем PCA с нормализацией (scale. = TRUE)\n",
    "pca_res <- prcomp(X, scale. = TRUE)\n",
    "\n",
    "# 3. Визуализация 1: Scree Plot \n",
    "p1 <- fviz_eig(pca_res, addlabels = TRUE, ylim = c(0, 80)) +\n",
    "  labs(title = \"Важность компонент (Scree Plot)\", y = \"% Дисперсии\")\n",
    "\n",
    "# 4. Визуализация 2: Biplot \n",
    "p2 <- fviz_pca_biplot(pca_res, \n",
    "                geom.ind = \"point\", \n",
    "                pointshape = 21, \n",
    "                pointsize = 2,\n",
    "                fill.ind = y,       \n",
    "                col.var = \"black\",  \n",
    "                repel = TRUE,       \n",
    "                alpha.ind = 0.6,    \n",
    "                palette = \"jco\", \n",
    "                addEllipses = TRUE) + \n",
    "  labs(title = \"PCA Biplot: Разделение сортов изюма\")\n",
    "\n",
    "grid.arrange(p1, p2, ncol = 2)\n",
    "\n",
    "summary(pca_res)\n"
   ]
  },
