   "source": [
    "# 1. Формируем новый датасет: берем только PC1 и PC2 + целевую метку\n",
    "pca_data <- data.frame(\n",
    "  PC1 = pca_res$x[, 1],\n",
    "  PC2 = pca_res$x[, 2],\n",
    "  Class = as.factor(df$Class)\n",
    ")\n",
    "\n",
    "# 2. Делим на Train (80%) и Test (20%)\n",
    "set.seed(123) \n",
    "train_index <- createDataPartition(pca_data$Class, p = 0.8, list = FALSE)\n",
    "train_data <- pca_data[train_index, ]\n",
    "test_data  <- pca_data[-train_index, ]\n",
    "\n",
    "# 3. Обучаем Логистическую регрессию (glm)\n",
    "model_logit <- train(\n",
    "  Class ~ ., \n",
    "  data = train_data, \n",
    "  method = \"glm\", \n",
    "  family = \"binomial\"\n",
    ")\n",
    "\n",
    "# 4. Проверяем точность на Тестовой выборке\n",
    "predictions <- predict(model_logit, newdata = test_data)\n",
    "conf_matrix <- confusionMatrix(predictions, test_data$Class)\n",
    "\n",
    "print(conf_matrix)\n",
    "\n",
    "print(summary(model_logit$finalModel))\n"
   ]
