   "source": [
    "\n",
    "# 1. Создаем сетку точек для фона (чтобы закрасить области)\n",
    "x_range <- seq(min(pca_data$PC1), max(pca_data$PC1), length.out = 100)\n",
    "y_range <- seq(min(pca_data$PC2), max(pca_data$PC2), length.out = 100)\n",
    "grid_data <- expand.grid(PC1 = x_range, PC2 = y_range)\n",
    "\n",
    "# 2. Предсказываем класс для каждой точки фона\n",
    "grid_data$Class <- predict(model_logit, newdata = grid_data)\n",
    "\n",
    "# 3. Рисуем красивый график\n",
    "ggplot() +\n",
    "  geom_tile(data = grid_data, aes(x = PC1, y = PC2, fill = Class), alpha = 0.3) +\n",
    "  geom_point(data = pca_data, aes(x = PC1, y = PC2, color = Class), size = 2, alpha = 0.8) +\n",
    "  scale_fill_manual(values = c(\"skyblue\", \"pink\"), name = \"Зона (Прогноз)\") +\n",
    "  scale_color_manual(values = c(\"blue\", \"red\"), name = \"Факт\") +\n",
    "  labs(title = \"Граница решений Логистической регрессии (PCA)\",\n",
    "       subtitle = paste(\"Accuracy:\", round(conf_matrix$overall['Accuracy'], 4)),\n",
    "       x = \"PC1 (Размер)\",\n",
    "       y = \"PC2 (Форма)\") +\n",
    "  theme_minimal()\n"
   ]
  },
