   "source": [
    "Изначально в датасете было 7 признаков. Но с учетом мультиколлинеарности, часть из них 100% можно было бы откинуть. Ну не может быть изюма, с большой площадью и малым периметром. Поэтому был сделан PCA анализ и там видно на biplot графике, что половина стрелок имеют минимальный угол между друг другом, значит они сильно коррелируют. После сжатия стало видно, что первые две компоненты объясняют 90% дисперсии.\n",
    "Логистическая регрессия, обученная на pc1, pc2 дала точность почти 87% на тестовой выборке. По последнему графику с границей решений видно, что большая часть ошибко возникает там, где точки пересекаются.\n",
    "Коэффициенты регрессии статистически значимы для обеих компонент."
   ]
  },
