   "source": [
    "# --- Блок 1: Загрузка и Очистка ---\n",
    "library(tidyverse)\n",
    "library(cluster)    # Для кластеризации\n",
    "library(factoextra) # Для визуализации PCA и кластеров\n",
    "\n",
    "# 1. Загрузка (обычно файл называется \"CC GENERAL.csv\")\n",
    "# Если не сработает, попробуйте \"../input/ccdata/CC GENERAL.csv\"\n",
    "df_cc <- read_csv(\"/kaggle/input/ccdata/CC GENERAL.csv\", show_col_types = FALSE)\n",
    "\n",
    "# 2. Удаляем ID (он не несет смысла)\n",
    "df_clean <- df_cc %>% select(-CUST_ID)\n",
    "\n",
    "# 3. Проверка пропусков\n",
    "print(\"Количество пропусков до чистки:\")\n",
    "print(colSums(is.na(df_clean)))\n",
    "\n",
    "# 4. Заполнение пропусков медианой (чтобы не терять данные)\n",
    "df_clean <- df_clean %>%\n",
