    "\n",
    "# 3. Визуализация вклада переменных (чтобы понять физический смысл осей)\n",
    "fviz_pca_var(pca_res,\n",
    "             col.var = \"contrib\", # Цвет зависит от вклада переменной\n",
    "             gradient.cols = c(\"#00AFBB\", \"#E7B800\", \"#FC4E07\"),\n",
    "             repel = TRUE) +\n",
    "  labs(title = \"PCA: Какие переменные формируют оси PC1 и PC2\")\n",
    "\n",
    "# 4. Сохраняем результат для следующего шага (кластеризации)\n",
    "pca_data <- as.data.frame(pca_res$x[, 1:2])\n",
    "print(\"Размерность сжатых данных:\")\n",
    "print(dim(pca_data))\n"
   ]
