   "source": [
    "set.seed(42) # Фиксируем результат\n",
    "kmeans_final <- kmeans(pca_data, centers = 3, nstart = 25)\n",
    "\n",
    "# Добавляем метки кластеров в данные\n",
    "pca_data$Cluster <- as.factor(kmeans_final$cluster)\n",
    "\n",
    "# 1. Визуализация кластеров\n",
    "fviz_cluster(kmeans_final, data = pca_data[, 1:2],\n",
    "             geom = \"point\",\n",
    "             ellipse.type = \"convex\", \n",
    "             ggtheme = theme_minimal()) +\n",
    "  labs(title = \"Сегментация клиентов банка (K=3)\",\n",
    "       subtitle = \"Визуализация на главных компонентах\",\n",
    "       x = \"PC1 (Покупки)\", y = \"PC2 (Авансы и Баланс)\")\n",
    "\n",
    "# 2. Оценка качества (Средний силуэт)\n",
    "sil <- silhouette(kmeans_final$cluster, dist(pca_data[, 1:2]))\n",
    "mean_sil <- mean(sil[, 3])\n",
    "print(paste(\"Средний коэффициент силуэта:\", round(mean_sil, 3)))\n"
   ]
  },
