   "source": [
    "Оба метода кластеризации указанли на 3 кластера.\n",
    "Первый кластер - высокие значения покупок, низкие значения частоты снятия денег (и долга по кредитке вместе с этим)\n",
    "Второй кластер - часто пользуются кредиткой, но видимо в основном для снятия налички, покупок мало.\n",
    "Третий кластер - люди, которые почти не пользуются кредиткой, либо пользуются очень осторожно \n",
    "Средний коэффициент силуэта 0.451, нормальный результат, не уверен, что можно считать хорошим, в этой области.\n",
    "\n",
    "Еще уточняю. Я интерпретировал баланс не как в описании датасета, а как \"сумма потраченная с карты\". Потому что в обсуждениях были подобные сообщения > \"The credit limit is the maximum amount of money that a credit card holder can spend using their credit card. A balance is the subset of the credit card limit that the cardholder currently owes or has used. Cash advance is a transaction where the cardholder receives funds in advance, typically before making a purchase.\"\n",
    "Хотя там были и обратные утверждения, но я жестко запсиопил себя, и решил, что вариант с суммой долга мне нравится больше"
   ]
  },
