   "source": [
    "# Будем решать задачу регрессии по Recovery Rate\n",
    "library(tidyverse)\n",
    "library(caret)      # Для ML\n",
    "library(corrplot)   # Для корреляций\n",
    "\n",
    "# 1. Загрузка данных\n",
    "df_health <- read_csv(\"/kaggle/input/global-health-statistics/Global Health Statistics.csv\", show_col_types = FALSE)\n",
    "\n",
    "# 2. Чистим имена (стандартная процедура)\n",
    "colnames(df_health) <- make.names(colnames(df_health))\n",
    "print(\"Список колонок:\")\n",
    "print(colnames(df_health))\n",
    "\n",
    "# 3. Выбираем только числовые колонки для анализа\n",
    "df_numeric <- df_health %>% select_if(is.numeric) %>% na.omit()\n",
    "\n",
    "# 4. Строим матрицу корреляций\n",
    "cor_matrix <- cor(df_numeric)\n",
    "corrplot(cor_matrix, method = \"color\", type = \"upper\", \n",
    "         tl.cex = 0.6, tl.col = \"black\", addCoef.col = \"black\", number.cex = 0.5)"
   ]
  },
