   "source": [
    "set.seed(123)\n",
    "\n",
    "# 1. Делим на Train/Test (80/20)\n",
    "index <- createDataPartition(df_numeric$Recovery.Rate...., p = 0.8, list = FALSE)\n",
    "train_data <- df_numeric[index, ]\n",
    "test_data  <- df_numeric[-index, ]\n",
    "\n",
    "# 2. Обучаем Линейную Регрессию (lm) на всех признаках\n",
    "model_base <- lm(Recovery.Rate.... ~ ., data = train_data)\n",
    "\n",
    "# 3. Делаем предсказания\n",
    "pred_base <- predict(model_base, newdata = test_data)\n",
    "\n",
    "# 4. Считаем метрики качества (RMSE и R2)\n",
    "rmse_base <- RMSE(pred_base, test_data$Recovery.Rate....)\n",
    "r2_base <- R2(pred_base, test_data$Recovery.Rate....)\n",
    "\n",
    "print(paste(\"Базовая модель RMSE:\", round(rmse_base, 3)))\n",
    "print(paste(\"Базовая модель R2:\", round(r2_base, 3)))\n"
   ]
  },
