   "source": [
    "library(factoextra)\n",
    "\n",
    "# 1. Готовим данные для PCA \n",
    "X_train <- train_data %>% select(-Recovery.Rate....)\n",
    "X_test  <- test_data  %>% select(-Recovery.Rate....)\n",
    "\n",
    "# 2. Обучаем PCA на тренировочных данных\n",
    "pca_model <- prcomp(X_train, scale. = TRUE)\n",
    "\n",
    "# 3. Смотрим, сколько компонент нужно для 90% дисперсии\n",
    "eig_val <- get_eigenvalue(pca_model)\n",
    "n_comp <- which(eig_val$cumulative.variance.percent > 90)[1]\n",
    "print(paste(\"Для 90% дисперсии берем компонент:\", n_comp))\n",
    "\n",
    "# 4. Трансформируем данные (оставляем n_comp компонент)\n",
    "train_pca <- data.frame(predict(pca_model, X_train)[, 1:n_comp])\n",
    "test_pca  <- data.frame(predict(pca_model, X_test)[, 1:n_comp])\n",
    "\n",
    "train_pca$Target <- train_data$Recovery.Rate....\n",
    "test_pca$Target  <- test_data$Recovery.Rate....\n",
    "\n",
    "# 5. Обучаем модель на сжатых данных\n",
    "model_pca <- lm(Target ~ ., data = train_pca)\n",
    "pred_pca <- predict(model_pca, newdata = test_pca)\n",
    "\n",
    "# 6. Оценка\n",
    "rmse_pca <- RMSE(pred_pca, test_pca$Target)\n",
    "r2_pca <- R2(pred_pca, test_pca$Target)\n",
    "\n",
    "print(paste(\"PCA Модель RMSE:\", round(rmse_pca, 3)))\n",
    "print(paste(\"PCA Модель R2:\", round(r2_pca, 3)))\n"
   ]
  },
